import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Navbar from '../navbar-footer/Navbar';

const Reports = () => {
  const [reports, setReports] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const reportsPerPage = 5;
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const token = localStorage.getItem('token');
  const baseURL = process.env.REACT_APP_BACK_END_BASE_URL || "";

  useEffect(() => {
    setLoading(true);
    axios.get(`${baseURL}/api/prescription/report`, {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    })
      .then(response => {
        setReports(response.data);
        setLoading(false);
      })
      .catch(err => {
        setError('Failed to load reports.');
        setLoading(false);
      });
  }, [token]);

  const indexOfLastReport = currentPage * reportsPerPage;
  const indexOfFirstReport = indexOfLastReport - reportsPerPage;
  const currentReports = reports.slice(indexOfFirstReport, indexOfLastReport);
  const totalPages = Math.ceil(reports.length / reportsPerPage);

  const handlePrev = () => {
    if (currentPage > 1) setCurrentPage(prev => prev - 1);
  };

  const handleNext = () => {
    if (currentPage < totalPages) setCurrentPage(prev => prev + 1);
  };

  return (
    <>
      <Navbar />
      <div style={{ maxWidth: '1000px', margin: '40px auto', padding: '20px', backgroundColor: '#f9f9f9', borderRadius: '8px' }}>
        <h2 style={{ textAlign: 'center', marginBottom: '30px' }}>Prescription Report</h2>

        {loading && <p>Loading...</p>}
        {error && <p style={{ color: 'red' }}>{error}</p>}

        {!loading && !error && (
          <>
            <table style={{
              width: '100%',
              borderCollapse: 'separate',
              borderSpacing: '0 10px',
              textAlign: 'left',
            }}>
              <thead>
                <tr style={{ backgroundColor: '#e0e0e0' }}>
                  <th style={styles.th}>Date</th>
                  <th style={styles.th}>Prescription Count</th>
                </tr>
              </thead>
              <tbody>
                {currentReports.length === 0 ? (
                  <tr>
                    <td colSpan="2" style={{ textAlign: 'center', padding: '20px' }}>No data available</td>
                  </tr>
                ) : (
                  currentReports.map((report, index) => (
                    <tr key={index} style={index % 2 === 0 ? styles.evenRow : styles.oddRow}>
                      <td style={styles.td}>{report.day}</td>
                      <td style={styles.td}>{report.count}</td>
                    </tr>
                  ))
                )}
              </tbody>
            </table>

            <div style={{ marginTop: '30px', display: 'flex', justifyContent: 'center', alignItems: 'center', gap: '15px' }}>
              <button onClick={handlePrev} disabled={currentPage === 1} style={styles.button}>
                Previous
              </button>
              <span style={{ fontWeight: 'bold' }}>Page {currentPage} of {totalPages}</span>
              <button onClick={handleNext} disabled={currentPage === totalPages} style={styles.button}>
                Next
              </button>
            </div>
          </>
        )}
      </div>
    </>
  );
};

const styles = {
  th: {
    padding: '12px 16px',
    borderBottom: '2px solid #ccc',
    fontWeight: 'bold',
  },
  td: {
    padding: '12px 16px',
    backgroundColor: '#fff',
    border: '1px solid #ddd',
    borderRadius: '4px',
  },
  evenRow: {
    backgroundColor: '#f7f7f7',
  },
  oddRow: {
    backgroundColor: '#ffffff',
  },
  button: {
    padding: '8px 16px',
    fontSize: '14px',
    borderRadius: '4px',
    border: '1px solid #888',
    backgroundColor: '#ffffff',
    cursor: 'pointer',
  },
};

export default Reports;
